import React from 'react'

const DUMMY_EVENTS = [
  { id: 'e1', title: 'some event' },
  { id: 'e2', title: 'another event' },
  { id: 'e3', title: 'third event' },
]
const EventsPage = () => {
  return (
    <>
      <h3>EventsPage</h3>
      <ul>
        {DUMMY_EVENTS.map(event => <li key={event.id}><Link></Link>{event.title}</li>)}
      </ul>
    </>
  )
}

export default EventsPage
